// src/pages/FacultyDashboard.js
import React from 'react';

export default function FacultyDashboard() {
  const facultyName = "Faculty Name"; // Replace with dynamic name if needed

  return (
    <div style={styles.container}>
      <h2>Welcome, {facultyName}</h2>

      <div style={styles.cardsContainer}>
        <Card title="Request UID" />
        <Card title="UID Status" />
        <Card title="Publication Submission" />
        <Card title="Submit Indexing Proof" />
        <Card title="My Submissions" />
        <Card title="Approved PIDs" value="2" />
        <Card title="Incentive Status" value="3 Pending" />
        <Card title="Notifications" />
        <Card title="Publication Summary" />
      </div>
    </div>
  );
}

function Card({ title, value }) {
  return (
    <div style={styles.card}>
      <h4>{title}</h4>
      {value && <p>{value}</p>}
    </div>
  );
}

const styles = {
  container: {
    padding: '30px',
    fontFamily: 'Arial, sans-serif'
  },
  cardsContainer: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fill, minmax(200px, 1fr))',
    gap: '20px',
    marginTop: '20px'
  },
  card: {
    backgroundColor: '#f0f4f8',
    padding: '20px',
    borderRadius: '10px',
    boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
    textAlign: 'center'
  }
};
